import React from 'react';
import {
    Box,
    Typography,
    Card,
    CardContent,
    useTheme,
    Avatar,
    Link,
    Stack,
    Tooltip,
    Collapse
} from '@mui/material';
import { TreeView, TreeItem } from '@mui/lab';
import {
    Email as EmailIcon,
    Phone as PhoneIcon,
    LinkedIn as LinkedInIcon,
    LocationOn as LocationIcon,
    Business as BusinessIcon,
    ExpandMore,
    ChevronRight
} from '@mui/icons-material';
import { User } from '../types/User';

// Mock data with hierarchy
const mockUsers: User[] = [
    {
        id: 1,
        name: 'John Doe',
        team: 'Executive',
        location: 'New York',
        jobRole: 'CEO',
        imageUrl: '',
        email: 'john.doe@company.com',
        phone: '+1 (555) 000-0001',
        linkedin: 'linkedin.com/in/johndoe',
        directReports: [2, 3]
    },
    {
        id: 2,
        name: 'Sarah Williams',
        team: 'Engineering',
        location: 'San Francisco',
        jobRole: 'CTO',
        imageUrl: '',
        email: 'sarah.williams@company.com',
        phone: '+1 (555) 000-0002',
        linkedin: 'linkedin.com/in/sarahwilliams',
        managerId: 1,
        directReports: [4, 5]
    },
    {
        id: 3,
        name: 'Michael Brown',
        team: 'Operations',
        location: 'Chicago',
        jobRole: 'COO',
        imageUrl: '',
        email: 'michael.brown@company.com',
        phone: '+1 (555) 000-0003',
        linkedin: 'linkedin.com/in/michaelbrown',
        managerId: 1,
        directReports: [6, 7]
    },
    {
        id: 4,
        name: 'Emily Davis',
        team: 'Engineering',
        location: 'Seattle',
        jobRole: 'Engineering Manager',
        imageUrl: '',
        email: 'emily.davis@company.com',
        phone: '+1 (555) 000-0004',
        linkedin: 'linkedin.com/in/emilydavis',
        managerId: 2
    },
    {
        id: 5,
        name: 'David Wilson',
        team: 'Engineering',
        location: 'Boston',
        jobRole: 'Tech Lead',
        imageUrl: '',
        email: 'david.wilson@company.com',
        phone: '+1 (555) 000-0005',
        linkedin: 'linkedin.com/in/davidwilson',
        managerId: 2
    },
    {
        id: 6,
        name: 'Lisa Anderson',
        team: 'Operations',
        location: 'Miami',
        jobRole: 'Operations Manager',
        imageUrl: '',
        email: 'lisa.anderson@company.com',
        phone: '+1 (555) 000-0006',
        linkedin: 'linkedin.com/in/lisaanderson',
        managerId: 3
    },
    {
        id: 7,
        name: 'Robert Taylor',
        team: 'Operations',
        location: 'Houston',
        jobRole: 'Project Manager',
        imageUrl: '',
        email: 'robert.taylor@company.com',
        phone: '+1 (555) 000-0007',
        linkedin: 'linkedin.com/in/roberttaylor',
        managerId: 3
    }
];

interface RenderTreeProps {
    user: User;
    users: User[];
}

const UserProfileCard = ({ user }: { user: User }) => {
    const theme = useTheme();

    return (
        <Card sx={{ 
            m: 1,
            width: 280,
            '&:hover': {
                boxShadow: theme.shadows[8],
                transform: 'translateY(-2px)',
                transition: 'all 0.2s'
            }
        }}>
            <CardContent>
                <Stack spacing={2}>
                    <Box sx={{ display: 'flex', alignItems: 'center', gap: 2 }}>
                        <Avatar
                            src={user.imageUrl || `https://ui-avatars.com/api/?name=${encodeURIComponent(user.name)}&background=random`}
                            alt={user.name}
                            sx={{ width: 56, height: 56 }}
                        />
                        <Box>
                            <Typography variant="h6" sx={{ fontSize: '1rem' }}>
                                {user.name}
                            </Typography>
                            <Typography color="text.secondary" variant="body2">
                                {user.jobRole}
                            </Typography>
                        </Box>
                    </Box>

                    <Stack spacing={1}>
                        <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                            <BusinessIcon fontSize="small" color="action" />
                            <Typography variant="body2" color="text.secondary">
                                {user.team}
                            </Typography>
                        </Box>
                        <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                            <LocationIcon fontSize="small" color="action" />
                            <Typography variant="body2" color="text.secondary">
                                {user.location}
                            </Typography>
                        </Box>
                        <Tooltip title="Send email">
                            <Link 
                                href={`mailto:${user.email}`}
                                sx={{ 
                                    display: 'flex',
                                    alignItems: 'center',
                                    gap: 1,
                                    color: 'inherit',
                                    textDecoration: 'none',
                                    '&:hover': { color: theme.palette.primary.main }
                                }}
                            >
                                <EmailIcon fontSize="small" color="action" />
                                <Typography variant="body2" noWrap>
                                    {user.email}
                                </Typography>
                            </Link>
                        </Tooltip>
                        <Tooltip title="Call">
                            <Link 
                                href={`tel:${user.phone}`}
                                sx={{ 
                                    display: 'flex',
                                    alignItems: 'center',
                                    gap: 1,
                                    color: 'inherit',
                                    textDecoration: 'none',
                                    '&:hover': { color: theme.palette.primary.main }
                                }}
                            >
                                <PhoneIcon fontSize="small" color="action" />
                                <Typography variant="body2">
                                    {user.phone}
                                </Typography>
                            </Link>
                        </Tooltip>
                        <Tooltip title="View LinkedIn profile">
                            <Link 
                                href={`https://www.${user.linkedin}`}
                                target="_blank"
                                rel="noopener noreferrer"
                                sx={{ 
                                    display: 'flex',
                                    alignItems: 'center',
                                    gap: 1,
                                    color: 'inherit',
                                    textDecoration: 'none',
                                    '&:hover': { color: theme.palette.primary.main }
                                }}
                            >
                                <LinkedInIcon fontSize="small" color="action" />
                                <Typography variant="body2" noWrap>
                                    {user.linkedin}
                                </Typography>
                            </Link>
                        </Tooltip>
                    </Stack>
                </Stack>
            </CardContent>
        </Card>
    );
};

const RenderTree = ({ user, users }: RenderTreeProps) => {
    const directReports = users.filter(u => u.managerId === user.id);

    return (
        <TreeItem
            nodeId={user.id.toString()}
            label={<UserProfileCard user={user} />}
            sx={{
                '& .MuiTreeItem-content': {
                    p: 0,
                    m: 0
                }
            }}
        >
            {directReports.map((report) => (
                <RenderTree key={report.id} user={report} users={users} />
            ))}
        </TreeItem>
    );
};

const OrgChart: React.FC = () => {
    const theme = useTheme();
    const rootUser = mockUsers.find(user => !user.managerId);

    if (!rootUser) {
        return (
            <Typography color="error">
                No root user found in the organization
            </Typography>
        );
    }

    return (
        <Box sx={{ width: '100%', pt: 2 }}>
            <Typography variant="h4" component="h1" sx={{ mb: 4 }}>
                Organization Chart
            </Typography>
            <Card sx={{ minHeight: 'calc(100vh - 180px)', overflow: 'auto' }}>
                <CardContent>
                    <TreeView
                        defaultExpanded={['1']}
                        defaultCollapseIcon={<ExpandMore />}
                        defaultExpandIcon={<ChevronRight />}
                        sx={{ 
                            flexGrow: 1,
                            maxWidth: '100%',
                            overflowY: 'auto',
                            '& .MuiTreeItem-group': {
                                ml: 4,
                                borderLeft: `1px dashed ${theme.palette.primary.main}`,
                                position: 'relative',
                                '&::before': {
                                    content: '""',
                                    position: 'absolute',
                                    top: 0,
                                    left: 0,
                                    width: 20,
                                    height: 1,
                                    bgcolor: theme.palette.primary.main
                                }
                            }
                        }}
                    >
                        <RenderTree user={rootUser} users={mockUsers} />
                    </TreeView>
                </CardContent>
            </Card>
        </Box>
    );
};

export default OrgChart;
